import { Col, Row, Container, Stack, Tooltip, Button, OverlayTrigger } from "react-bootstrap";
import { React } from "react";
import Triangle from "../components/Triangle.PNG";
import TriangleDimensions from "../components/TriangleDimensions";

function DrawTriangles( ) {

    const tooltip = (props) => (
        <Tooltip id="button-tooltip" {...props}>
            Generate a triangle of any any size or shape.
        </Tooltip>
    )

    return (
        <Container fluid>
            <h1>Trigonometric Ratios Practice</h1>
            <Row>
                <Col sm={8}><img src={Triangle} /></Col>
                <Col sm={4}>
                    <Stack gap={4}>
                        <br></br>
                        <TriangleDimensions></TriangleDimensions>
                    </Stack>
                </Col>
            </Row>
            <Row>
                <Col sm={{ span: 6, offset: 1 }}>

                </Col>
                <Col sm={{ span: 3, offset: 1 }}>
                    <Stack gap={5}>
                        <OverlayTrigger   
                            placement="left"
                            overlay={tooltip}
                        >
                            <Button variant="warning">Show me a random triangle</Button>
                        </OverlayTrigger>
                    </Stack>
                </Col>
            </Row>
        </Container>
    )
};

export default DrawTriangles;
